import React, { useEffect, useState } from 'react';
import getList from "../../../data/news.json";
import "./style.css";

const NewsList = () => {

   const [list, setList] = useState(getList);
    //const {id, title, description, content} = list;
    //console.log(id);

    return(
        <div className='news-list'>
            <div className="news-list-full-size">
                <div className="news-list__wrapper">
                    <ul className="news-list__list">
                        {list.map((item) => {
                            const {id, title, description, content} = item;
                            <li className="news-list__list__item" key={id}>{id}</li>
                        })}
                    </ul>
                </div>
            </div>
        </div>
    )
}

export default NewsList;
